#include <bits/stdc++.h>
 
typedef long long ll;
 
#define pb push_back
#define MS(x,y) memset((x),(y),sizeof((x)))
#define mn 1000000
 
using namespace std;
 
unordered_map<int, vector<string>> mapa;
pair<int, vector<string>> rez = {0,{}};
unordered_map<string, bool> vis;
 
bool odg(string str1, string str2) {
    if (str1.length() > str2.length()) swap(str1,str2);
 
    int prvBr[26] = {0};
    int vtorBr[26] = {0};
 
    for (auto it:str1) prvBr[it-'A']++;
    for (auto it:str2) vtorBr[it-'A']++;
 
    int raz = 0;
 
    for (int i = 0; i<26; i++) {
        if (prvBr[i] > vtorBr[i]) return false;
        else raz += vtorBr[i]-prvBr[i];
    }
 
    return raz == 1;
}
 
pair<int, vector<string>> rek(string str) {
    pair<int,vector<string>> best = {0, {}};
 
    vis[str] = true;
 
    for (auto it:mapa[str.length()+1]) {
        if (!vis.count(it)) {
            if (odg(str,it)) {
                auto orel = rek(it);
                if (orel.first > best.first) best = orel;
            }
        }
    }
 
    best.first++;
    best.second.pb(str);
 
    return best;
}
 
